import React, { Component } from 'react'

class User extends Component
{
    constructor() 
    {
        super()
        console.log('constructor')
        this.state = {
            name: 'abc'
        }
    }



    render()
    {
        console.log('render')
        return(
            <div>
                <h1>React</h1>
                <p>{this.state.name}</p>
                <button onClick={() => {(this.setState = {name: 'xyz'})}}>Update</button>
            </div>
        )
    }
}

export default User
